public class sumFirstTwoAndMultiplyThird {
    public static void main(String[] args) {
        System.out.println(sumMult(4, 5, 7));
    }

    public static int sumMult(int a, int b, int c) {
        int d = (a + b) * c;
        return d;
    }
}
